import React from 'react';
import style from '../About/About.module.css'

const About = () => {
    return(
        <div className={style.aboutContainer}>
            <h1>Hi everyone!!</h1>
            <br></br>
            <h2>My name is Karina and I'm in "class 35b" of Henry's bootcamp. Born and raised in Argentina, now I'm learning in "full stack developer" and I'm very happy to be part of this community at 
            Henry's.
            This is my first proyect so far and I hope you all enjoy it as much as I, when I made it. Thank you so much for seen my work here, have a wonderfull life!</h2>
        </div>
    )
}

export default About
